  { path: "/", element: <HoomePage /> },
  { path: "/events", element: <Event /> },
  { path: "/", element: <HoomePage /> },
  { path: "/", element: <HoomePage /> },
  { path: "/", element: <HoomePage /> },
]);

function App() {
  return <div></div>;
}

export default App;
